        stack = []
        i = 0
        while i < len(text):
            char = text[i]
            if char.isalpha():
                stack.append(char)
            elif char == ' ':
                if len(stack) > 0:
                    stack.pop()
                else:
                    i += 1
                    continue
            i += 1
        return stack

